/**
 * Interfaz para métodos de pago con logo
 */
export interface PaymentMethod {
  name: string;
  logoBase64?: string; // Logo en base64 (el usuario lo agregará)
}

/**
 * Lista de métodos de pago disponibles con logos
 * Esta lista se usa en PaymentMethodSelect y en los filtros de tickets
 */
export const PAYMENT_METHODS: PaymentMethod[] = [
  { name: 'Mercado Pago', logoBase64: '' },
  { name: 'Zelle', logoBase64: '' },
  { name: 'Zinli', logoBase64: '' },
  { name: 'Binance', logoBase64: ''},
  { name: 'Pago Móvil', logoBase64: 'ask' },
  { name: 'Transferencia Bancaria', logoBase64: 'ask' },
  { name: 'PayPal', logoBase64: '' },
  { name: 'Payoneer', logoBase64: '' },
  { name: 'Wise', logoBase64: '' },
  { name: 'Western Union', logoBase64: '' },
  { name: 'MoneyGram', logoBase64: '' },
  { name: 'Efectivo', logoBase64: '' },
  { name: 'Criptomonedas', logoBase64: '' },
];

/**
 * Obtiene el logo de un método de pago por su nombre
 */
export function getPaymentMethodLogo(methodName: string): string | undefined {
  const method = PAYMENT_METHODS.find(m => m.name === methodName);
  return method?.logoBase64;
}

